import { Link } from "react-router-dom"

const EVENTS = [
    {id: 'e1', title: 'abc'},
    {id: 'e2', title: 'def'},
    {id: 'e3', title: 'ghi'},
    {id: 'e4', title: 'jkl'},
    {id: 'e5', title: 'mno'}
]
export default function EventsPage() {
    return (
    <>
    <h1>Events Page</h1>
    <ul>{EVENTS.map((event) => (<li id={event.id}>{<Link to={`/events/${event.id}`}>{event.title}</Link>}</li>))}</ul>
    </>
    )
}
